import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Autocomplete, AutocompleteChangeDetails } from '@mui/material';
import { useSelector } from 'react-redux';
import { selectExperience } from '../redux/experience/experience.selector';
import { selectStatus } from '../redux/status/status.selector';
import { useState } from 'react';
import Map from '../components/Map';
function Copyright(props: any) {
  return (
    <Typography variant="body2" color="text.secondary" align="center" {...props}>
      {'Copyright Â© '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

export default function SignUpForm() {
    const experiences=useSelector(selectExperience)
    const status=useSelector(selectStatus)
    const [address, setAddress]=useState("")
    const [x, setX]=useState(0)
    const [y, setY]=useState(0)
    const [st,setSt]=useState<string>("")
    const [ex,setEx]=useState<string>("")
  const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get('email'),
      password: data.get('password'),
      experience:data.get('experience'),
      status: data.get('status'),
      name:(data!.get('first name')?.toString()!)+(data!.get('last name')?.toString()!),
      x:x,
      y:y
    });
  };
//   const autocompleteInputEx= document.getElementById("experience");

// // Listen for the 'change' event

// const autocompleteInputSt = document.getElementById("status");
React.useEffect(()=>{
    const autocompleteInputEx= document.getElementById("experience");
    const autocompleteInputSt = document.getElementById("status");
    autocompleteInputEx?.addEventListener('change', function(event:any) {

        const selectedValue = event?.target.value;
        setEx(selectedValue)
        // Do something with the selected value
        console.log('Selected value:', selectedValue);
    });
    autocompleteInputSt?.addEventListener('change', function(event:any) {
        const selectedValue = event?.target.value;
        setSt(selectedValue)
        // Do something with the selected value
        console.log('Selected value:', selectedValue);
    });
})
// Listen for the 'change' event


  return (
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Sign up
          </Typography>
          <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }}>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <TextField
                  autoComplete="given-name"
                  name="firstName"
                  required
                  fullWidth
                  id="firstName"
                  label="First Name"
                  autoFocus
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  required
                  fullWidth
                  id="lastName"
                  label="Last Name"
                  name="lastName"
                  autoComplete="family-name"
                />
              </Grid>
              <Grid item xs={12} >
                <Autocomplete
                disablePortal
                id="experience"
                
                options={experiences}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Experience" />}
                />
              </Grid>
              <Grid item xs={12} >
              <Autocomplete
                disablePortal
                id="status"
                options={status}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Status" />}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="email"
                  label="Email Address"
                  name="email"
                  autoComplete="email"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="new-password"
                />
              </Grid>
              <Grid item xs={12}>
                <Map setAddress={setAddress} setX={setX} setY={setY}/>
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="address"
                  label="Address"
                  type="address"
                  id="address"
                  autoComplete="new-address"
                  value={address}
                />
              </Grid>
              <Grid item xs={12}>
                <FormControlLabel
                  control={<Checkbox value="allowExtraEmails" color="primary" />}
                  label="I want to receive inspiration, marketing promotions and updates via email."
                />
              </Grid>
            </Grid>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              Sign Up
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link href="#" variant="body2">
                  Already have an account? Sign in
                </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
        <Copyright sx={{ mt: 5 }} />
      </Container>
    </ThemeProvider>
  );
}
